import React from 'react';
import styled from 'styled-components';

const AriclesWrapper = styled.div`

`;

const ArticlesItem = styled.div`
  display: grid;
  grid-template-columns: 1fr 1fr 1fr 1fr;
`;

const ArticlesInfo = styled.div`
  display: grid;
  grid-column: span 3;
  grid-template-rows: 1fr 1fr 1fr;
`;

const ArticlesTitle = styled.span`
  color: #1890FF;
  font-size: 20px;
`;

const ArticlesStats = styled.div`
  display: grid;
`;

const ArticlesLikesCount = styled.span``;

const ArticlesUserInfo = styled.div`
  display: grid;
  grid-column: 4 / 5;
`;

const ArticlesTagsWrap = styled.div`

`;

const ArticlesTag = styled.span``;

const ArticlesDescription = styled.p``;

const ArticlesUserInfoGroup = styled.div``;

const ArticlesUsername = styled.p``;

const ArticlesDate = styled.p``;

const ArticlesUserImage = styled.img``;

const ArticlesList = () => {

  return (
    <AriclesWrapper>
      <ArticlesItem>
        <ArticlesInfo>
          <ArticlesTitle>Some article title</ArticlesTitle>
          <ArticlesStats>
            <div className="img"></div>
            <ArticlesLikesCount>10</ArticlesLikesCount>
          </ArticlesStats>
          <ArticlesTagsWrap>
            <ArticlesTag>tag</ArticlesTag>
            <ArticlesTag>someTag</ArticlesTag>
          </ArticlesTagsWrap>

          <ArticlesDescription></ArticlesDescription>
        </ArticlesInfo>

        <ArticlesUserInfo>
          <ArticlesUserInfoGroup>
            <ArticlesUsername></ArticlesUsername>
            <ArticlesDate></ArticlesDate>
          </ArticlesUserInfoGroup>
          <ArticlesUserImage></ArticlesUserImage>
        </ArticlesUserInfo>
      </ArticlesItem>
    </AriclesWrapper>
  )
}

export default ArticlesList;
